import React, { Component } from "react";

import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  //WARNING! To be deprecated in React v17. Use componentDidMount instead.
  constructor(props) {
    super(props);
    this.state = {
      response: []
    };
  }

  componentWillMount() {
    fetch("https://api.github.com/repos/octocat/Hello-World/issues", {
      Method: "GET"
    })
      .then(data => {
        return data.json();
      })
      .then(response => {
        console.log("data is::" + JSON.stringify(response));
        this.setState({
          response
        });
      });
  }
  render() {
    return (
      <div className="root">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>{JSON.stringify(this.state.response)}</p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
